import classes from './Categories.module.css';
import Showdropdownlist from './Showdropdownlist';

const Categories = () => {
    return (
            <span className={classes.dropdown}>
                <button className={`${classes.dropbtn} ${classes.svgicon}`}>
                    <span>All Categories</span>
                    <svg width="24px" height="24px" viewBox="0 0 1024 1024" data-aut-id="icon" fill-rule="evenodd"><path class="rui-4K4Y7" d="M85.392 277.333h60.331l366.336 366.336 366.336-366.336h60.331v60.331l-408.981 409.003h-35.307l-409.045-409.003z"></path></svg>
                </button>
                <div className={classes.dropdowncontent}>
                    <ul>
                        <li>Electronics</li>
                        <li>Hardware</li>
                        <li>Accessories</li>
                        <li>Vehicle</li>
                        <li>Academics</li>
                    </ul>
                </div>
            </span>
    );
}
 
export default Categories;
